import React, { Component } from "react";
import { Link } from "react-router-dom";
import Accordion from 'react-bootstrap/Accordion';

class LeftMenuContent extends Component {

  render() {
    const { document } = this.props;

    return (
      
      
      
        <li className="nav-item">
          <div class="collapse" id="submenu1" aria-expanded="false">
            <Accordion >
            <Link to="/" className="nav-link collapsed text-truncate"
            to="/"
            data-toggle="collapse"
            data-target="#submenu1"
          >
            <span className="d-none d-sm-inline side-nav-title">
              {document.subject}
            </span>
          </Link>
                <Accordion.Toggle as={document.subject} variant="link" eventKey="0" >
                    <h3>{document.subject}</h3>
                </Accordion.Toggle>
                <Accordion.Collapse className="p-2" eventKey="0">
                   <Link to={`/dashboard/${document.documentId}`}>
                    <h5>{document.topic}</h5>
                   </Link>   
                </Accordion.Collapse>
            </Accordion>
          </div>
        </li>
      
  
    );
  }
}

export default LeftMenuContent;
